create table wc_weekcalendar (
   id                   char(32)             not null,
   id_school            char(32)             null,
   id_schoolterm        char(32)             null,
   weekNumber           int                  null,
   status               char(1)              null,
   ft                   char(19)             null,
   lt                   char(19)             null,
   fu                   char(32)             null,
   lu                   char(32)             null
)
